lass="my-1 flex items-center gap-1 text-sm font-semibold outline-none text-token-text-tertiary" type="button" aria-haspopup="dialog" aria-expanded="false" aria-controls="radix-:r2bq:" data-state="closed"><svg xmlns="http://www.w3.org/2000/svg" width="18" height="18" fill="none" viewBox="0 0 18 18" class="mb-[-1px]"><path fill="currentColor" d="M6 3a2 2 0 0 0-2 2v8a2 2 0 0 0 2 2zM7 3v12h1.18l.31-1.548a1.5 1.5 0 0 1 .41-.766l3.393-3.393A2.4 2.4 0 0 1 14 8.586V3.5a.5.5 0 0 0-.5-.5z"></path><path fill="currentColor" d="m11.351 15.53-1.616.323a.5.5 0 0 1-.588-.588l.323-1.617a.5.5 0 0 1 .137-.255L13 10a1.414 1.414 0 1 1 2 2l-3.393 3.393a.5.5 0 0 1-.256.137"></path></svg>Memory updated</button></div><div class="flex flex-grow flex-col max-w-full"><div data-message-author-role="assistant" data-message-id="a171d77d-1597-41c1-9683-061db5af2196" dir="auto" class="min-h-[20px] text-message flex w-full flex-col items-end gap-2 whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 overflow-x-auto"><div class="flex w-full flex-col gap-1 empty:hidden first:pt-[3px]"><div class="markdown prose w-full break-words dark:prose-invert dark"><p>Here's a more complex stored procedure for your airline database. This procedure retrieves flight information along with booking details and passenger information for a specific flight. It combines data from multiple tables and provides a comprehensive view of the flight, including the list of passengers who have booked on that flight.</p><pre><div class="dark bg-gray-950 rounded-md border-[0.5px] border-token-border-medium"><div class="flex items-center relative text-token-text-secondary bg-token-main-surface-secondary px-4 py-2 text-xs font-sans justify-between rounded-t-md"><span>sql</span><div class="flex items-center"><span class="" data-state="closed"><button class="flex gap-1 items-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-sm"><path fill="currentColor" fill-rule="evenodd" d="M7 5a3 3 0 0 1 3-3h9a3 3 0 0 1 3 3v9a3 3 0 0 1-3 3h-2v2a3 3 0 0 1-3 3H5a3 3 0 0 1-3-3v-9a3 3 0 0 1 3-3h2zm2 2h5a3 3 0 0 1 3 3v5h2a1 1 0 0 0 1-1V5a1 1 0 0 0-1-1h-9a1 1 0 0 0-1 1zM5 9a1 1 0 0 0-1 1v9a1 1 0 0 0 1 1h9a1 1 0 0 0 1-1v-9a1 1 0 0 0-1-1z" clip-rule="evenodd"></path></svg>Copy code</button></span></div></div><div class="overflow-y-auto p-4" dir="ltr"><code class="!whitespace-pre hljs language-sql">DELIMITER <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

<span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">PROCEDURE</span> GetFlightDetails(<span class="hljs-keyword">IN</span> flightID <span class="hljs-type">INT</span>)
<span class="hljs-keyword">BEGIN</span>
    <span class="hljs-keyword">SELECT</span>
        f.flight_id,
        f.airline,
        f.source,
        f.destination,
        f.departure_time,
        f.arrival_time,
        f.duration,
        f.price,
        b.booking_id,
        b.passenger_id,
        b.booking_date,
        b.seat_number,
        p.first_name,
        p.last_name,
        p.email,
        p.phone_number
    <span class="hljs-keyword">FROM</span> flights f
    <span class="hljs-keyword">LEFT</span> <span class="hljs-keyword">JOIN</span> bookings b <span class="hljs-keyword">ON</span> f.flight_id <span class="hljs-operator">=</span> b.flight_id
    <span class="hljs-keyword">LEFT</span> <span class="hljs-keyword">JOIN</span> passengers p <span class="hljs-keyword">ON</span> b.passenger_id <span class="hljs-operator">=</span> p.passenger_id
    <span class="hljs-keyword">WHERE</span> f.flight_id <span class="hljs-operator">=</span> flightID;
<span class="hljs-keyword">END</span> <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

DELIMITER ;
</code></div></div></pre><h3>Explanation:</h3><ol><li><strong>Parameters</strong>: <code>IN flightID INT</code> specifies the flight ID for which the details are retrieved.</li><li><strong>SELECT Statement</strong>: Retrieves information from <code>flights</code>, <code>bookings</code>, and <code>passengers</code> tables.</li><li><strong>Joins</strong>: Uses <code>LEFT JOIN</code> to include all flights and their associated bookings and passengers. If there are no bookings for a flight, the flight details are still included.</li><li><strong>WHERE Clause</strong>: Filters the results to include only the flight with the specified <code>flightID</code>.</li></ol><p>To execute this procedure, you would call it like this:</p><pre><div class="dark bg-gray-950 rounded-md border-[0.5px] border-token-border-medium"><div class="flex items-center relative text-token-text-secondary bg-token-main-surface-secondary px-4 py-2 text-xs font-sans justify-between rounded-t-md"><span>sql</span><div class="flex items-center"><span class="" data-state="closed"><button class="flex gap-1 items-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-sm"><path fill="currentColor" fill-rule="evenodd" d="M7 5a3 3 0 0 1 3-3h9a3 3 0 0 1 3 3v9a3 3 0 0 1-3 3h-2v2a3 3 0 0 1-3 3H5a3 3 0 0 1-3-3v-9a3 3 0 0 1 3-3h2zm2 2h5a3 3 0 0 1 3 3v5h2a1 1 0 0 0 1-1V5a1 1 0 0 0-1-1h-9a1 1 0 0 0-1 1zM5 9a1 1 0 0 0-1 1v9a1 1 0 0 0 1 1h9a1 1 0 0 0 1-1v-9a1 1 0 0 0-1-1z" clip-rule="evenodd"></path></svg>Copy code</button></span></div></div><div class="overflow-y-auto p-4" dir="ltr"><code class="!whitespace-pre hljs language-sql"><span class="hljs-keyword">CALL</span> GetFlightDetails(<span class="hljs-number">123</span>);
</code></div></div></pre><p>Replace <code>123</code> with the actual flight ID you want to query.</p></div></div></div></div><div class="mt-1 flex gap-3 empty:hidden -ml-2"><div class="items-center justify-start rounded-xl p-1 z-10 -mt-1 bg-token-main-surface-primary md:absolute md:border md:border-token-border-light md:hidden"><div class="flex items-center"><span class="" data-state="closed"><button class="rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary"><span class="flex h-[30px] w-[30px] items-center justify-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-md-heavy"><path fill="currentColor" fill-rule="evenodd" d="M11 4.91a.5.5 0 0 0-.838-.369L6.676 7.737A1 1 0 0 1 6 8H4a1 1 0 0 0-1 1v6a1 1 0 0 0 1 1h2a1 1 0 0 1 .676.263l3.486 3.196A.5.5 0 0 0 11 19.09zM8.81 3.067C10.415 1.597 13 2.735 13 4.91v14.18c0 2.175-2.586 3.313-4.19 1.843L5.612 18H4a3 3 0 0 1-3-3V9a3 3 0 0 1 3-3h1.611zm11.507 3.29a1 1 0 0 1 1.355.401A10.96 10.96 0 0 1 23 12c0 1.85-.458 3.597-1.268 5.13a1 1 0 1 1-1.768-.934A8.96 8.96 0 0 0 21 12a8.96 8.96 0 0 0-1.085-4.287 1 1 0 0 1 .402-1.356M15.799 7.9a1 1 0 0 1 1.4.2 6.48 6.48 0 0 1 1.3 3.9c0 1.313-.39 2.537-1.06 3.56a1 1 0 0 1-1.673-1.096A4.47 4.47 0 0 0 16.5 12a4.47 4.47 0 0 0-.9-2.7 1 1 0 0 1 .2-1.4" clip-rule="evenodd"></path></svg></span></button></span><span class="" data-state="closed"><button class="rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary"><span class="flex h-[30px] w-[30px] items-center justify-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-md-heavy"><path fill="currentColor" fill-rule="evenodd" d="M7 5a3 3 0 0 1 3-3h9a3 3 0 0 1 3 3v9a3 3 0 0 1-3 3h-2v2a3 3 0 0 1-3 3H5a3 3 0 0 1-3-3v-9a3 3 0 0 1 3-3h2zm2 2h5a3 3 0 0 1 3 3v5h2a1 1 0 0 0 1-1V5a1 1 0 0 0-1-1h-9a1 1 0 0 0-1 1zM5 9a1 1 0 0 0-1 1v9a1 1 0 0 0 1 1h9a1 1 0 0 0 1-1v-9a1 1 0 0 0-1-1z" clip-rule="