 max-w-full"><div data-message-author-role="assistant" data-message-id="17848075-4668-447b-aade-aa33db207929" dir="auto" class="min-h-[20px] text-message flex w-full flex-col items-end gap-2 whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 overflow-x-auto"><div class="flex w-full flex-col gap-1 empty:hidden first:pt-[3px]"><div class="markdown prose w-full break-words dark:prose-invert dark"><p>Certainly! Here are a few example triggers for your airline database:</p><h3>1. <strong>Trigger to Update Booking Date</strong></h3><p>This trigger updates the <code>booking_date</code> to the current date when a new booking is inserted.</p><pre><div class="dark bg-gray-950 rounded-md border-[0.5px] border-token-border-medium"><div class="flex items-center relative text-token-text-secondary bg-token-main-surface-secondary px-4 py-2 text-xs font-sans justify-between rounded-t-md"><span>sql</span><div class="flex items-center"><span class="" data-state="closed"><button class="flex gap-1 items-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-sm"><path fill="currentColor" fill-rule="evenodd" d="M7 5a3 3 0 0 1 3-3h9a3 3 0 0 1 3 3v9a3 3 0 0 1-3 3h-2v2a3 3 0 0 1-3 3H5a3 3 0 0 1-3-3v-9a3 3 0 0 1 3-3h2zm2 2h5a3 3 0 0 1 3 3v5h2a1 1 0 0 0 1-1V5a1 1 0 0 0-1-1h-9a1 1 0 0 0-1 1zM5 9a1 1 0 0 0-1 1v9a1 1 0 0 0 1 1h9a1 1 0 0 0 1-1v-9a1 1 0 0 0-1-1z" clip-rule="evenodd"></path></svg>Copy code</button></span></div></div><div class="overflow-y-auto p-4" dir="ltr"><code class="!whitespace-pre hljs language-sql">DELIMITER <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

<span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">TRIGGER</span> BeforeInsertBooking
BEFORE <span class="hljs-keyword">INSERT</span> <span class="hljs-keyword">ON</span> bookings
<span class="hljs-keyword">FOR</span> <span class="hljs-keyword">EACH</span> <span class="hljs-type">ROW</span>
<span class="hljs-keyword">BEGIN</span>
    <span class="hljs-keyword">SET</span> NEW.booking_date <span class="hljs-operator">=</span> NOW();
<span class="hljs-keyword">END</span> <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

DELIMITER ;
</code></div></div></pre><h3>2. <strong>Trigger to Prevent Booking for Past Flights</strong></h3><p>This trigger prevents inserting a booking for a flight that is already in the past.</p><pre><div class="dark bg-gray-950 rounded-md border-[0.5px] border-token-border-medium"><div class="flex items-center relative text-token-text-secondary bg-token-main-surface-secondary px-4 py-2 text-xs font-sans justify-between rounded-t-md"><span>sql</span><div class="flex items-center"><span class="" data-state="closed"><button class="flex gap-1 items-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-sm"><path fill="currentColor" fill-rule="evenodd" d="M7 5a3 3 0 0 1 3-3h9a3 3 0 0 1 3 3v9a3 3 0 0 1-3 3h-2v2a3 3 0 0 1-3 3H5a3 3 0 0 1-3-3v-9a3 3 0 0 1 3-3h2zm2 2h5a3 3 0 0 1 3 3v5h2a1 1 0 0 0 1-1V5a1 1 0 0 0-1-1h-9a1 1 0 0 0-1 1zM5 9a1 1 0 0 0-1 1v9a1 1 0 0 0 1 1h9a1 1 0 0 0 1-1v-9a1 1 0 0 0-1-1z" clip-rule="evenodd"></path></svg>Copy code</button></span></div></div><div class="overflow-y-auto p-4" dir="ltr"><code class="!whitespace-pre hljs language-sql">DELIMITER <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

<span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">TRIGGER</span> CheckFlightDateBeforeBooking
BEFORE <span class="hljs-keyword">INSERT</span> <span class="hljs-keyword">ON</span> bookings
<span class="hljs-keyword">FOR</span> <span class="hljs-keyword">EACH</span> <span class="hljs-type">ROW</span>
<span class="hljs-keyword">BEGIN</span>
    <span class="hljs-keyword">DECLARE</span> flightDate DATETIME;

    <span class="hljs-keyword">SELECT</span> departure_time <span class="hljs-keyword">INTO</span> flightDate
    <span class="hljs-keyword">FROM</span> flights
    <span class="hljs-keyword">WHERE</span> flight_id <span class="hljs-operator">=</span> NEW.flight_id;

    IF flightDate <span class="hljs-operator">&lt;</span> NOW() <span class="hljs-keyword">THEN</span>
        SIGNAL <span class="hljs-keyword">SQLSTATE</span> <span class="hljs-string">'45000'</span>
        <span class="hljs-keyword">SET</span> MESSAGE_TEXT <span class="hljs-operator">=</span> <span class="hljs-string">'Cannot book a flight that has already departed.'</span>;
    <span class="hljs-keyword">END</span> IF;
<span class="hljs-keyword">END</span> <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

DELIMITER ;
</code></div></div></pre><h3>3. <strong>Trigger to Update Flight Duration</strong></h3><p>This trigger automatically updates the <code>duration</code> of a flight based on the <code>departure_time</code> and <code>arrival_time</code> when either of those values is updated.</p><pre><div class="dark bg-gray-950 rounded-md border-[0.5px] border-token-border-medium"><div class="flex items-center relative text-token-text-secondary bg-token-main-surface-secondary px-4 py-2 text-xs font-sans justify-between rounded-t-md"><span>sql</span><div class="flex items-center"><span class="" data-state="closed"><button class="flex gap-1 items-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-sm"><path fill="currentColor" fill-rule="evenodd" d="M7 5a3 3 0 0 1 3-3h9a3 3 0 0 1 3 3v9a3 3 0 0 1-3 3h-2v2a3 3 0 0 1-3 3H5a3 3 0 0 1-3-3v-9a3 3 0 0 1 3-3h2zm2 2h5a3 3 0 0 1 3 3v5h2a1 1 0 0 0 1-1V5a1 1 0 0 0-1-1h-9a1 1 0 0 0-1 1zM5 9a1 1 0 0 0-1 1v9a1 1 0 0 0 1 1h9a1 1 0 0 0 1-1v-9a1 1 0 0 0-1-1z" clip-rule="evenodd"></path></svg>Copy code</button></span></div></div><div class="overflow-y-auto p-4" dir="ltr"><code class="!whitespace-pre hljs language-sql">DELIMITER <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

<span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">TRIGGER</span> UpdateFlightDuration
BEFORE <span class="hljs-keyword">UPDATE</span> <span class="hljs-keyword">ON</span> flights
<span class="hljs-keyword">FOR</span> <span class="hljs-keyword">EACH</span> <span class="hljs-type">ROW</span>
<span class="hljs-keyword">BEGIN</span>
    IF OLD.departure_time <span class="hljs-operator">&lt;&gt;</span> NEW.departure_time <span class="hljs-keyword">OR</span> OLD.arrival_time <span class="hljs-operator">&lt;&gt;</span> NEW.arrival_time <span class="hljs-keyword">THEN</span>
        <span class="hljs-keyword">SET</span> NEW.duration <span class="hljs-operator">=</span> TIMESTAMPDIFF(<span class="hljs-keyword">MINUTE</span>, NEW.departure_time, NEW.arrival_time);
    <span class="hljs-keyword">END</span> IF;
<span class="hljs-keyword">END</span> <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

DELIMITER ;
</code></div></div></pre><h3>4. <strong>Trigger to Log Changes to Flight Prices</strong></h3><p>This trigger logs changes to flight prices into a separate table named <code>price_changes</code>.</p><p>First, create the <code>price_changes</code> table:</p><pre><div class="dark bg-gray-950 rounded-md border-[0.5px] border-token-border-medium"><div class="flex items-center relative text-token-text-secondary bg-token-main-surface-secondary px-4 py-2 text-xs font-sans justify-between rounded-t-md"><span>sql</span><div class="flex items-center"><span class="" data-state="closed"><button class="flex gap-1 items-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-sm"><path fill="currentColor" fill-rule="evenodd" d="M7 5a3 3 0 0 1 3-3h9a3 3 0 0 1 3 3v9a3 3 0 0 1-3 3h-2v2a3 3 0 0 1-3 3H5a3 3 0 0 1-3-3v-9a3 3 0 0 1 3-3h2zm2 2h5a3 3 0 0 1 3 3v5h2a1 1 0 0 0 1-1V5a1 1 0 0 0-1-1h-9a1 1 0 0 0-1 1zM5 9a1 1 0 0 0-1 1v9a1 1 0 0 0 1 1h9a1 1 0 0 0 1-1v-9a1 1 0 0 0-1-1z" clip-rule="evenodd"></path></svg>Copy code</button></span></div></div><div class="overflow-y-auto p-4" dir="ltr"><code class="!whitespace-pre hljs language-sql"><span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">TABLE</span> price_changes (
    change_id <span class="hljs-type">INT</span> AUTO_INCREMENT <span class="hljs-keyword">PRIMARY</span> KEY,
    flight_id <span class="hljs-type">INT</span>,
    old_price <span class="hljs-type">DECIMAL</span>(<span class="hljs-number">10</span>, <span class="hljs-number">2</span>),
    new_price <span class="hljs-type">DECIMAL</span>(<span class="hljs-number">10</span>, <span class="hljs-number">2</span>),
    change_date DATETIME,
    <span class="hljs-keyword">FOREIGN</span> KEY (flight_id) <span class="hljs-keyword">REFERENCES</span> flights(flight_id)
);
</code></div></div></pre><p>Now, create the trigger:</p><pre><div class="dark bg-gray-950 rounded-md border-[0.5px] border-token-border-medium"><div class="flex items-center relative text-token-text-secondary bg-token-main-surface-secondary px-4 py-2 text-xs font-sans justify-between rounded-t-md"><span>sql</span><div class="flex items-center"><span class="" data-state="closed"><button class="flex gap-1 items-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-sm"><path fill="currentColor" fill-rule="evenodd" d="M7 5a3 3 0 0 1 3-3h9a3 3 0 0 1 3 3v9a3 3 0 0 1-3 3h-2v2a3 3 0 0 1-3 3H5a3 3 0 0 1-3-3v-9a3 3 0 0 1 3-3h2zm2 2h5a3 3 0 0 1 3 3v5h2a1 1 0 0 0 1-1V5a1 1 0 0 0-1-1h-9a1 1 0 0 0-1 1zM5 9a1 1 0 0 0-1 1v9a1 1 0 0 0 1 1h9a1 1 0 0 0 1-1v-9a1 1 0 0 0-1-1z" clip-rule="evenodd"></path></svg>Copy code</button></span></div></div><div class="overflow-y-auto p-4" dir="ltr"><code class="!whitespace-pre hljs language-sql">DELIMITER <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

<span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">TRIGGER</span> LogPriceChange
AFTER <span class="hljs-keyword">UPDATE</span> <span class="hljs-keyword">ON</span> flights
<span class="hljs-keyword">FOR</span> <span class="hljs-keyword">EACH</span> <span class="hljs-type">ROW</span>
<span class="hljs-keyword">BEGIN</span>
    IF OLD.price <span class="hljs-operator">&lt;&gt;</span> NEW.price <span class="hljs-keyword">THEN</span>
        <span class="hljs-keyword">INSERT</span> <span class="hljs-keyword">INTO</span> price_changes (flight_id, old_price, new_price, change_date)
        <span class="hljs-keyword">VALUES</span> (NEW.flight_id, OLD.price, NEW.price, NOW());
    <span class="hljs-keyword">END</span> IF;
<span class="hljs-keyword">END</span> <span class="hljs-operator">/</span><span class="hljs-operator">/</span>

DELIMITER ;
</code></div></div></pre><h3>Explanation:</h3><ul><li><strong>Before Insert Booking Trigger</strong>: Automatically sets the booking date when a new booking is made.</li><li><strong>Check Flight Date Before Booking Trigger</strong>: Prevents bookings for flights that have already departed.</li><li><strong>Update Flight Duration Trigger</strong>: Recalculates the flight duration if departure or arrival times are changed.</li><li><strong>Log Price Change Trigger</strong>: Records changes in flight prices into a <code>price_changes</code> table.</li></ul><p>Feel free to adjust these triggers based on your specific needs and business rules.</p></div></div></div></div><div class="mt-1 flex gap-3 empty:hidden -ml-2"><div class="items-center justify-start rounded-xl p-1 z-10 -mt-1 bg-token-main-surface-primary md:absolute md:border md:border-token-border-light md:hidden"><div class="flex items-center"><span class="" data-state="closed"><button class="rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary"><span class="flex h-[30px] w-[30px] items-center justify-center"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" class="icon-md-heavy"><path fill="currentColor" fill-rule="evenodd" d="M11 4.91a.5.5 0 0 0-.838-.369L6.676 7.737A1 1 0 0 1 6 8H4a1 1 0 0 0-1 1v6a1 1 0 0 0 1 1h2a1 1 0 0 1 .676.263l3.486 3.196A.5.5 0 0 0 11 19.09zM8.81 3.067C10.415 1.597 13 2.735 13 4.91v14.18c0 2.175-2.586 3.313-4.19 1.843L5.612 18H4a3 3 0 0 1-3-3V9a3 3 0 0 1 3-3h1.611zm11.507 3.29a1 1 0 0 1 1.355.401A10.96 10.96 0 0 1 23 12c0 1.85-.458 3.597-1.268 5.13a1 1 0 1 1-1.768-.934A8.96 8.96 0 0 0 21 12a8.96 8.96 0 0 0-1.085-4.287 1 1 0 0 1 .402-1.356M15.799 7.9a1 1 0 0 1 1.4.2 6.48 6.48 0 0 1 1.3 3.9c0 1.313-.39 2.537-1.06 3.56a1 1 0 0 1-1.673-1.096A4.47 4.47 0 0 0 16.5 12a4.47 4.47 0 0 0-.9-2.7 1 1 0 0 1 .2-1.4" clip-rule="evenodd"></path></svg></span></button></span><span class="" data-state="closed"><button class="rounded-lg text-to